) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='t_issued_cert 테이블에는 발급된 모든 인증서 정보가 들어가며 최대 500만건의 데이터가 들어간다. 그렇기때문에 cert_cn을 group by해서 보여주는 경우 성능저하가 발생한다. 그래서 데이터가 중복되더라도 cn별 가장 마지막 인증서를 이 테이블에 따로 저장한다.';
