DROP TABLE IF EXISTS `t_log_cert`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_log_cert` (
  `dttm` datetime NOT NULL,
  `request_id` varchar(25) NOT NULL COMMENT '요청에 대한 아이디. \napi요청마다 한개씩 발급됨\n',
  `request_type` varchar(20) NOT NULL COMMENT 'CERT_ISSUE\nCERT_REVOKE\nCERT_LIST\nCERT_GET\nCERT_VALID\n',
  `cert_id` varchar(25) DEFAULT NULL COMMENT '생성 또는 폐기한 인증서 아이디',
  `user_id` varchar(25) NOT NULL,
